$(document).ready(function(){$("#search-box").keyup(function(e){13==e.keyCode&&$("#search").trigger("click")}),$("#search").on("click",function(){var e=encodeURI($("#search-box").blur().val());$.ajax({url:"https://en.wikipedia.org/w/api.php",dataType:"jsonp",data:{action:"query",format:"json",generator:"search",gsrsearch:e,gsrlimit:"10"},success:function(e){$("#results ul").empty();var t=e.query.pages;for(var o in t)$("#results ul").append('<li class="col-xs-12 col-md-4"><a href="https://en.wikipedia.org/wiki/'+t[o].title+'" target="_new" class="content-block"><h4>'+t[o].title+"</h4></a></li>")}})})});
